using System;
using System.IO;

namespace S3Core
{
    public static class Helper
    {
        public static string GetPathAssets() => Environment.CurrentDirectory + "/assets";
        
        public static string GetPathImage() => GetPathAssets() + "/image.jpg";

        public static string GetFileInBase64() => "";

        public static byte[] GetFileInBytes() => File.ReadAllBytes(GetPathImage());
    }
}
